import React,{useState} from 'react';
import './App.css';
import LogIn from "./component/LogIn"

const [value,setValue]=useState(false)

function App() {
  return (
    <div className="App">
      {value===true?<LogIn></LogIn>:<button onClick={e=>setValue(true)}>LogIn</button>}


    </div>
  );
}

export default App;
